function PopupWithForm({
  title,
  name,
  onOpen,
  onClose,
  btnCurrentText,
  children,
}) {
  return (
    <section className={`popup popup_${name} ${onOpen ? "popup_opened" : ""}`}>
      <div className="popup__container popup__container-form">
        <button class="popup__close" type="button" onClose={onClose}></button>
        <h2 className="popup__title">{title}</h2>
        <form className="form form_element" name={name} noValidate>
          <button className="form__button" type="submit" name="element">
            {btnCurrentText}
          </button>
        </form>
      </div>
    </section>
  );
}

export default PopupWithForm;
